import React from 'react';
import HomePageContent from './components/homepage.js';
import DashboardContent from './components/Dashboard.js';
import GradeReportPageContent from './components/GradeReportPage.js';
import MissingGradeFormPageContent from './components/MissingGradeFormPage.js';
import InstructorContactPageContent from './components/InstructorContactPage.js';
import LoginPageContent from './components/LoginPage.js';
import HelpAndSupportPageContent from './components/HelpAndSupportPage.js';

const HomePage = ({ currentPage }) => {
  let pageContent;

  switch (currentPage) {
    case 'homepage':
      pageContent = <HomePageContent />;
      break;
    case 'dashboard':
      pageContent = <DashboardContent />;
      break;
    case 'grade-reporting':
      pageContent = <GradeReportPageContent />;
      break;
    case 'missing-grades':
      pageContent = <MissingGradeFormPageContent />;
      break;
    case 'instructor-contact':
      pageContent = <InstructorContactPageContent />;
      break;
    case 'login':
      pageContent = <LoginPageContent />;
      break;
    case 'help-and-support':
      pageContent = <HelpAndSupportPageContent />;
      break;
    default:
      pageContent = <div>Page not found</div>;
  }

  return (
    <div className="home-container">
      <div className="nav-bar">
        {/* Use onClick to change the currentPage state */}
        <button onClick={() => handlePageChange('homepage')}>Home</button>
        <button onClick={() => handlePageChange('dashboard')}>Dashboard</button>
        {/* Add buttons or links for other pages */}
      </div>
      <div className="content">
        {pageContent}
      </div>
      <div className="footer">
        {/* Add content for the footer */}
        <p>&copy; 2023 Your Company</p>
      </div>
    </div>
  );
};

export default HomePage;
